class FlimDetails extends Component {
	render() {
		return (
			<>
				<div>
					<h1>The Lord of the Rings: {this.props.title}</h1>
					<p>{this.props.hours}h {this.props.minutes}min</p>
				</div>
			</>
		);
	}
}

export default Movie;
